*blows nose* gah I'm sick.  I hate being sick.  but on one hand, i now have five-day-weekend under my belt, meaning only two days between me and my spring break.  but it would seriously suck if i was sick over spring break.  

and this senior video that was supposed to be a group thing has now become a Darren-only thing and it's stressing me out.  two seniors still...STILL...have not turned in their pictures and they were due almost two weeks ago.  so i have everyone scanned and in the computer with about 6 people cropped and touched up.  I talked to jim yesterday and I'm supposed to meet with him monday to conjure up some ideas on how to edit this thing.  so i have 5 days to get everyone cropped and touched up and all that jazz that takes so long to do.  somebody save me.

Enough about me.  how is everyone?  i havn't had enough free time to read anyone's lj in a long time.  >_o;;
